import React from 'react';
import { Rounte } from 'react-router-dom';
import './App.css';
import HomePage from './pages/homepage/hompage.component';

const HatsPage = () => (
  <div>
    <h1>HATS PAGE</h1>
  </div>
);

function App() {
  return (
    <div>
      <Route exact path='/' component={HomePage} />
      <Route path='/hats' component={HatsPage} />
    </div>
  );
}

export default App;
